// Bulk create from JSON files
$jsonFiles = File::glob(database_path('seeders/jsonstorage/*.json'));

echo "Found: " . count($jsonFiles) . " JSON files\n";

foreach ($jsonFiles as $filePath) {
    echo "Processing: $filePath\n";

    $data = json_decode(File::get($filePath), true);

    if (!$data) {
        echo "Skipping $filePath: invalid JSON\n";
        continue;
    }

    $basename = basename($filePath, '.json');

    $tableRows = '';

    foreach ($data as $row) {
        $service = $row['Layanan'] ?? $row['name'] ?? '-';
        $priceRaw = $row['Harga'] ?? $row['price'] ?? '0';

        echo "  Service: [$service]\n";
        echo "  Harga raw: [$priceRaw]\n";

        // Bersihkan
        $price = str_replace(['Rp', ' ', "\xc2\xa0", '.'], '', $priceRaw);

        echo "  Harga cleaned: [$price]\n";

        if (!is_numeric($price)) {
            echo "  -> NOT NUMERIC! fallback to 0\n";
            $price = 0;
        }

        $price = (float)$price;

        echo "  Harga final: [$price]\n";

        $tableRows .= '
            <tr class="hover:bg-gray-100">
                <td class="py-3 px-4">' . e($service) . '</td>
                <td class="py-3 px-4 text-right">Rp ' . number_format($price, 0, ',', '.') . '</td>
            </tr>';
    }

    $htmlAnswer = '
        <div class="container mx-auto px-4 py-8">
            <h1 class="text-2xl font-bold text-center mb-8">Daftar Layanan dan Harga: '.$basename.'</h1>
            <div class="overflow-x-auto">
                <table class="min-w-full bg-white rounded-lg overflow-hidden">
                    <thead class="bg-gray-800 text-white">
                        <tr>
                            <th class="w-3/4 py-3 px-4 text-left">Layanan</th>
                            <th class="w-1/4 py-3 px-4 text-right">Harga</th>
                        </tr>
                    </thead>
                    <tbody class="divide-y divide-gray-200">
                        '.$tableRows.'
                    </tbody>
                </table>
            </div>
        </div>';

    RawatJalan::create([
        'question' => "Harga layanan $basename",
        'answer' => $htmlAnswer,
        'match_type' => 'contains',
    ]);

    echo "Seeded: Harga layanan $basename\n";
}
